import { Rect, Stage } from 'happy-charts';

const s = { x: 0, height: 60, fillStyle: 'purple' };
const e = { x: 200, height: 200, fillStyle: 'red' };

const App = () => {
  const [state, setState] = useState(s);

  useEffect(() => {
    setTimeout(() => {
      state.x = 200;
      setState({ ...state });
    }, 500);

    setTimeout(() => {
      state.height = 200;
      state.fillStyle = 'red';
      setState({ ...state });
    }, 800);
  }, []);

  return (
    <Stage>
      <Rect
        x={state.x}
        y={50}
        width={100}
        height={state.height}
        fillStyle={state.fillStyle}
        shadowColor="red"
        cursor="pointer"
        animation={{ duration: 1000, easing: 'linear' }}
        onclick={() => {
          let _state;
          if (state.x == 200) {
            _state = { x: 0, height: 60, fillStyle: 'purple' };
          } else {
            _state = { x: 200, height: 200, fillStyle: 'red' };
          }
          setState(_state);
        }}
      />
    </Stage>
  );
};

export default App;
